import React from "react";

const TodoDetails = (props) => (
  <div className="d-flex justify-content-around">
    {/* <table>
      <thead>
        <tr>
          <th> ID</th>
          <th>Title</th>
          <th>Details</th>
        </tr>
      </thead> */}
    <ul>
      {props.todos.length > 0 ? (
        props.todos.map((todo) => (
          <ul key={todo.id}>
            <li>
              <a href="#">
                <h2>{todo.title}</h2>
                <p>{todo.details}Text Content #1</p>
              </a>
            </li>
          </ul>
        ))
      ) : (
        <p>
          <td colSpan={3}>You dont have any todo pending!</td>
        </p>
      )}
    </ul>
  </div>
);

export default TodoDetails;
